import Header from './IMAHeader';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const IMALayout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default IMALayout;
